C You Next Tuesday 4 (Jodi West, Forbidden Fruits Films / DvdRip / 2015)

When innocent women join this Tuesday Night Book Club, they find out deception and manipulation is in store for them! As the series continues, we find the first Mother-Daughter book club members trying to both co-exist in this Lesbian sexual romp! The tensions are high as good girls are preyed upon by more experienced lesbians!

Amber Lynn Bach, Callie Calypso, Jodi West, Kandie St. Andrews, Kimber Woods, Licious Gia

Lesbian, All Girl, Teens, MILFs

